import React, { Component} from 'react';
import {Grid, Cell} from 'react-mdl';

class Landing extends Component{
	render(){
		return(
			<div style = {{width: '100%', margin: 'auto'}}>
				<Grid className = "landing-grid">
					<Cell col={12}>
						<img
							src = "https://www.australia.com/content/australia/en_ie/facts/pictures/australias-animal-pictures/dingo/jcr:content/image.adapt.1200.HIGH.jpg"
							alt = "avatar"
							className = "avatar-img"
							/>

					<div className = "banner-text">
						<h1>Hi there!</h1>
						<hr/>
						<p>That is a picture of a dingo not me! Feel free to explore and learn more about me.
						</p>

						<div className = "social-links">
							{/*linkedIn */}
							<a href= "http://linkedin.com/in/kynmak/" rel = "noopener noreferrer" target="_blank">
								<i className="fa fa-linkedin-square"  aria-hidden="true" />
							</a>
							{/*Github */}
							<a href= "http://google.com" rel = "noopener noreferrer" target="_blank">
								<i className="fa fa-github-square"  aria-hidden="true" />
							</a>
						</div>

					</div>
					</Cell>
				</Grid>
			</div>
		)
	}
}

export default Landing;
